import React from 'react';
import { connect } from 'react-redux'
import './Styles/MenuBarStyles.css';
import { dispatch } from 'rxjs/internal/observable/pairs'
import MenuBarItem from './MenuBarItem'
import logo from '../../logo-1.png'
import { ping } from '../../Epics/index'

function MenuBar() {
  const { updatePostComment } = this.props
  return (
    <div className="Bar">
      <div className="Left">
        <img src={logo} className="Logo" alt="logo" />
        <MenuBarItem label="Home" onClick={updatePostComment} />
      </div>

      <div className="Right">
        <MenuBarItem label="Login" />
        <MenuBarItem label="Sign Up" />
      </div>
    </div>
  );
}


const mapStateToProps = state => ({
  profile: state.user.profile,
  loggedIn: state.auth.loggedIn
})

const mapDispatchToProps = {
  updatePostComment: dispatch(() => ping())
}

export default connect(mapStateToProps, mapDispatchToProps)(MenuBar)
